import React, { useState, useEffect } from 'react';
import Nav from './Nav';

function Cart() {
  const [cart, setCart] = useState([]);

  useEffect(() => {
    const storedCart = JSON.parse(localStorage.getItem('cart'));
    if (storedCart) {
      setCart(storedCart);
    }
  }, []);

  return (
    <div>
      <Nav links={Nav} />
    <div>
      <h1>Cart Menu</h1>
      <ul>
        {cart && cart.map((item, index) => (
          <li key={index}>{item.name}</li>
        ))}
      </ul>
    </div>
    </div>
  );
}

export default Cart;
